```solidity
pragma solidity ^0.5.0;

contract MyContract {
    mapping(address => uint) public balanceOf;
    mapping(address => mapping(address => uint)) public allowance;
    uint256 public totalsupply;
    uint256 public totalcount;
    string public name;
    uint8 public decimals;
    string public symbol;
    string public version;
    address payable public targer;

    constructor() public payable {
        if (msg.value == 0) {
            balanceOf[msg.sender] = 0x5afd67f2dc0e1b2e000000;
            balanceOf[msg.sender] -= 0x50d80ea58e3;
            totalsupply = 0xadb53acfa41aee12000000;
            totalcount = 0x52b7d2dcc80cd2e4000000;
            name = "0";
            decimals = 18;
            symbol = "0";
            targer = msg.sender;
        }
        version = "0";
    }

    function approve(address _spender, uint256 _value) public returns (bool success) {
        allowance[msg.sender][_spender] = _value;
        return true;
    }

    function () external payable {
        require(msg.value >= 0x5af3107a4000 && totalcount > 0);
        balanceOf[msg.sender] += 1000 * msg.value;
        balanceOf[targer] -= 1000 * msg.value;
        totalcount -= 1000 * msg.value;
    }

    function transferFrom(address _from, address _to, uint256 _value) public returns (bool success) {
        require(allowance[_from][msg.sender] >= _value && balanceOf[_from] >= _value);
        balanceOf[_to] += _value;
        balanceOf[_from] -= _value;
        if (allowance[_from][msg.sender] < 0xffffffffffffffffffffffffffffffffffffffffffffffffffffffffffffffff) {
            allowance[_from][msg.sender] -= _value;
        }
        return true;
    }

    function withdrawEther(uint256 amount) public {
        require(msg.sender == targer);
        targer.transfer(amount);
    }

    function transfer(address _to, uint256 _value) public returns (bool success) {
        require(balanceOf[msg.sender] >= _value);
        balanceOf[msg.sender] -= _value;
        balanceOf[_to] += _value;
        return true;
    }
}
```

